import React from 'react';
import Timer from './Timer.js';
import Geolocator from './utils/Geolocator.js';

class Home extends React.Component {

    updateCurrentLocation = (longitude, latitude) => {
        console.log(`UPDATING CURRENT POSITION ======> longitude: ${longitude} latitude: ${latitude}`)
    }
    render() {
        return (
            <div className="App fadeIn">
                <header className="App-content">
                    <a className="App-link bold greet p-20 r-10 w-200 bg-green brdr-green noUnderline"
                    href="https://jsongithub.github.io/portfolio/"
                    target="_self"
                    rel="noopener noreferrer"
                    >
                        portfolio
                    </a>
                    {/*<Lister items={[1,2,3]} />*/}
                    <Timer/>
                    Current position:<br/>
                    <Geolocator currentPositionExists="false" returnCurrentPosition={this.updateCurrentLocation}/>
                    <div className="button p-20 r-5 m-20 bg-neogreen completedSelector" onClick={this.startDistance}>Start Distance</div>
                </header>
            </div>
        );
    };
}

export default Home;
